port: 7892
socks-port: 7891
mixed-port: 7890
mode: rule
allow-lan: true
unified-delay: true
bind-address: '*'
log-level: debug
ipv6: true
geo-auto-update: true
geo-update-interval: 24 
external-controller: 0.0.0.0:9090 
external-ui: dashboard/metacubexd
external-ui-name: xd
external-ui-url: "https://github.com/MetaCubeX/metacubexd/archive/refs/heads/gh-pages.zip"
tcp-concurrent: true
global-client-fingerprint: chrome
geox-url:
  geoip: "https://raw.githubusercontent.com/Chocolate4U/Iran-v2ray-rules/release/geoip.dat"
  geosite: "https://raw.githubusercontent.com/Chocolate4U/Iran-v2ray-rules/release/geosite.dat"
  mmdb: "https://raw.githubusercontent.com/Chocolate4U/Iran-clash-rules/release/geoip.metadb"
  asn: "https://raw.githubusercontent.com/Chocolate4U/Iran-v2ray-rules/geolite2/GeoLite2-ASN.mmdb"
find-process-mode: always
profile:
  store-selected: true
  store-fake-ip: true
interface-name: ""
keep-alive-interval: 15 

sniffer:
  enable: false
  sniffing:
    - tls
    - http
  skip-domain:
    - 'Mijia Cloud'
    - 'dlg.io.mi.com'
    - '+.apple.com'
    - '*.baidu.com'
  force-domain:
    - '+'
    - '+.google.com'
  port-whitelist:
    - 80
    - 443
    - 8000-9000
tun:
  enable: true
  stack: MIXED
#system # gvisor / lwip
  dns-hijack:
    - any:53
    - any:5353
    - tcp://any:53
    - tcp://any:53
    - tcp://8.8.8.8:53
    - tcp://8.8.4.4:53
    - 192.18.0.0.1
    - 127.0.0.1
  # interface-name: 
  auto-route: true 
  auto-detect-interface: true 
  mtu: 9000 
  strict_route: true 
  inet4_route_address: 
    - 0.0.0.0/1
    - 128.0.0.0/1
  inet6_route_address: 
    - '::/1'
    - '8000::/1'
  endpoint_independent_nat: true 
dns:
  cache-algorithm: arc
  enable: true
  ipv6: true
  ipv6-timeout: 300
  prefer-h3: true
  listen: 0.0.0.0:1053
  enhanced-mode: fake-ip
  fake-ip-range: 114.0.0.0/16
  fake-ip-filter:
  - '*.lan'
  default-nameserver:
  - 94.140.14.141
  - 8.8.8.8
  - 1.1.1.1
  - 114.114.114.114
